import React, {Component} from 'react';
import axios from 'axios';
import { library } from "@fortawesome/free-solid-svg-icons";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";

export default class Competence extends Component {

  constructor(props) {
    super(props);
    this.state={
      competence:[],
      idCount:0
    }
  }

  componentDidMount() {
    let that = this;

    axios.get('http://localhost:4000/competence')
      .then(res => {
        res.data.forEach(function(competence) {
          that.setState({competence: [...that.state.competence, {value:competence.value, id:competence.id}]})
        });
        that.setState({idCount: res.data.length})
        console.log(this.state)
      })
      .catch(err => {
        console.log('A problem occured')
      });

      library.add(
        faMoneyBill,
        faCode,
        faHighlighter
      );
  }




  render() {
    return (
      <section id='competence' className='section'>
      <h2> Competence </h2>
      {
        this.state.competence.map((competence) => {
          importIcon();
          return(
            <div>
              <div>
                <FontAwesomeIcon icon={faHome} />
              </div>
              <p>{competence.value}</p>
            </div>
          )
        })
      }
      </section>
    )
  }
}
